- input: "TEXT\x1CC00301929\x1C.TEXT\x1C\x1CF3XA\x1CAs a sponsoring organization Kelley
    Drye Collier Shannon has provided free legal and accounting services to KDCS PAC
    as the services are solely to help the committee comply with federal campaign
    finance laws; and, because the individuals performing the services are regular
    employees of the organization consistent with Commission regulations at 100.86.
    \ The value of those services is $6500. The original mid-year 2007 report of receipts
    and disbursements incorrectly reported a contribution to Friends of John Boehner
    on May 22, 2007.  In fact, no contribution was made.  This report remedies that
    incorrect disclosure.  In addition, pursuant to an audit conducted by the Kelley
    Drye & Warren PAC, it was discovered that the original report failed to repor
    an operating expense of $190.71 for bank fees.  This amendment corrects that omission."
